import React from "react";
import styled from "styled-components";
import { Box, Typography, Grid, Stack } from "@mui/material";
// import axios from "axios";
// import { useSelector } from "react-redux";

const Rank = () => {
    const RankTen = [
        ["가싸피싸피싸", 10, 0, 100],
        ["나싸피", 10, 0, 90],
        ["다싸피", 10, 0, 80],
        ["라싸피", 10, 0, 70],
        ["마싸피", 10, 0, 60],
        ["바싸피", 10, 0, 50],
        ["사싸피", 10, 0, 40],
        ["아싸피", 10, 0, 30],
        ["자싸", 10, 0, 20],
        ["이싸피", 10, 0, 10],
    ];
    // const me = useSelector((state) => state.user);
    // axios({
    //     method: "get",
    //     url: "api/game/topRank",
    //     headers: {
    //         Authorization: `Bearer ` + me.accessToken,
    //     },
    // }).then((res) => {
    //     RankTen = res.data;
    // });
    const oneFive = RankTen.slice(0, 5);
    const sixTen = RankTen.slice(5, 10);
    return (
        <Box sx={{ border: "solid 1px", pl: 3, pt: 2, pb: 1, width: "500px" }}>
            <Typography variant="h4" sx={{ mb: 1 }} align="left">
                Rank
            </Typography>
            <UL>
                <Stack
                    direction="row"
                    justifyContent="center"
                    alignItems="center"
                    spacing={0.5}
                    sx={{ width: "500px" }}
                >
                    <Stack sx={{ width: "300px" }}>
                        {oneFive.map((name, index) => {
                            return (
                                <li key={index}>
                                    <Grid container sx={{ mt: 1 }}>
                                        <Grid item xs={3}>
                                            <Typography
                                                variant="h6"
                                                align="left"
                                            >
                                                {index + 1}위
                                            </Typography>
                                        </Grid>
                                        <Grid
                                            item
                                            xs={6}
                                        >
                                            <Typography
                                                variant="subtitle1"
                                                align="left"
                                            >
                                                {name[0]}
                                            </Typography>
                                        </Grid>
                                        <Grid item xs={3}>
                                            <Typography
                                                variant="caption"
                                                color="secondary"
                                                align="left"
                                            >
                                                {name[3]}
                                            </Typography>
                                        </Grid>
                                    </Grid>
                                </li>
                            );
                        })}
                    </Stack>
                    <Stack sx={{ width: "300px" }}>
                        {sixTen.map((name, index) => {
                            return (
                                <li key={index}>
                                    <Grid container sx={{ mt: 1 }}>
                                        <Grid item xs={3}>
                                            <Typography
                                                variant="h6"
                                                align="left"
                                            >
                                                {index + 6}위
                                            </Typography>
                                        </Grid>
                                        <Grid item xs={6}>
                                            <Typography
                                                variant="subtitle1"
                                                align="left"
                                            >
                                                {name[0]}
                                            </Typography>
                                        </Grid>
                                        <Grid item xs={3}>
                                            <Typography
                                                variant="caption"
                                                color="secondary"
                                                align="left"
                                            >
                                                {name[3]}
                                            </Typography>
                                        </Grid>
                                    </Grid>
                                </li>
                            );
                        })}
                    </Stack>
                </Stack>
            </UL>
        </Box>
    );
};
const UL = styled.section`
    list-style: none;
`;
export default Rank;
